import { Observable } from 'rxjs';
import { CustomService } from './../../service/custom.service';
import { Component, Inject, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { CustomFunctions } from 'src/app/shared/customFunctions/customFunctions';
import { FreelancerTypes, RoleTypes, AbrRoleTypes } from 'src/app/shared/ItemList/items';
import { ReCaptchaV3Service } from 'ngx-captcha';
import { DOCUMENT } from '@angular/common';
import { AppConfig } from 'src/app/config/config';

// import { ConfirmPasswordValidator } from './confirm-password.validator';
@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent implements OnInit {
  register$!: Observable<any>;
  registerForm!: FormGroup;
  submitted = false;
  userreg: any = {};
  errors: any = {};
  userId: any = {};
  email_id: any = {};
  error_msg!: string;
  isError: boolean = false;
  isFreelancer: boolean = false;
  countries$!: Observable<any>;
  services$!: Observable<any>;
  roleTypes = RoleTypes;
  abrroleTypes = AbrRoleTypes;
  freelancerTypes = FreelancerTypes;
  public captchaIsLoaded = false;
  public captchaSuccess = false;
  public captchaIsExpired = false;
  public captchaResponse?: string;

  public theme: 'light' | 'dark' = 'light';
  public size: 'compact' | 'normal' = 'normal';
  public lang = 'en';
  public type!: 'image' | 'audio';
  private serverUrl = `${this._appConfig.setting['PathAPI']}`;

  constructor(private customService: CustomService,
    @Inject(DOCUMENT) private document: Document,

    private formBuilder: FormBuilder,
    public _customFunctions: CustomFunctions,
    public customFunction: CustomFunctions,
    private _appConfig: AppConfig,

    // private reCaptchaV3Service: ReCaptchaV3Service,
    private router: Router) { }

  ngOnInit(): void {
    // this.reCaptchaV3Service.execute('6Lect8YgAAAAANkNNG6VDJdx6s5785GUAY3otaUb', 'homepage', (token) => {
    //   console.log('This is your token: ', token);
    // }, {
    //   useGlobalDomain: false
    // });
    this.countries$ = this.customService.Get(`Country`);
    this.services$ = this.customService.Get(`Service`);
    this.registerForm = this.createRegisterForm();
  }
  resolved(captchaResponse: string) {
    console.log(`Resolved captcha with response: ${captchaResponse}`);
  }
  createRegisterForm(): FormGroup {
    return this.formBuilder.group({
      FullName: ['', Validators.compose([Validators.required])],
      Email: ['', Validators.compose([Validators.required, Validators.email])],
      PhoneNumber: ['', Validators.compose([Validators.required])],
      Password: ['', Validators.compose([Validators.required])],
      ConfirmPassword: ['', Validators.compose([Validators.required])],
      Role: [null, Validators.compose([Validators.required])],
      FreelancerType: [1],
      ServiceId: [''],
      CountryId: ['', Validators.compose([Validators.required])],
      PrivacyAndTerms: [null, Validators.compose([Validators.required])],
      recaptcha: [null, Validators.compose([Validators.required])]
    });
  }
  getRegisterFormInfo(): any {
    if (this.registerForm.invalid) {
      console.log('please Insert All Form Data ');
      this._customFunctions.showResponseMessage('please Insert All Form Data', false);
      return;
    }
    const userInfo: any = {
      fullName: this.registerForm.controls.FullName.value,
      serviceId: this.registerForm.controls.FreelancerType.value == 1? null: this.registerForm.controls.ServiceId.value,
      email: this.registerForm.controls.Email.value,
      phoneNumber: this.registerForm.controls.PhoneNumber.value,
      role: this.registerForm.controls.Role.value.name,
      roleId: this.registerForm.controls.Role.value.id,
      freelancerType: this.registerForm.controls.FreelancerType.value,
      password: this.registerForm.controls.Password.value,
    };

    console.log('userInfo ', userInfo);

    return userInfo;
  }
  async registerUser(): Promise<void> {
    this.submitted = true;
    const userInfo = this.getRegisterFormInfo();
    console.log('userInfo2 ', userInfo);
    await this.customService.post(userInfo, 'Identity/Register').subscribe(async res => {
      if (res) {
        if (res.code <= 300) {
          this._customFunctions.showResponseMessage(res.description, res.code);
          this.router.navigate(['/account/login']);
        } else {
          this._customFunctions.showResponseMessage(res.description, res.code);
        }

        // this.clientForm.reset();
      }
    });
    // await this.customService.post(userInfo, 'Identity/Register').subscribe(async res => {
    //   if (res) {
    //     this._customFunctions.showResponseMessage(res.description, res.code);
    //     // this.clientForm.reset();
    //   }
    // });
  }
  onSelectUserType(type: any) {
    console.log('type ', type);
    if (type.id === 2 || type.id === 4) {
      this.isFreelancer = true;
    } else {
      this.isFreelancer = false;
    }
  }
  handleSuccess(data: any) {
    console.log(data);
  }
  googleLogin(): void {
    this.document.location.href = `${this.serverUrl}ExternalLogin/external-login?provider=Google&returnUrl=https://bhthy.com/#/`;
    // this.customService.post({}, `ExternalLogin/external-login?provider=Google&returnUrl=/home`)
    //   .subscribe(res => {
    //     console.log('googleLogin ', res);
    //   },
    //     (error) => {                              //Error callback
    //       console.error('error caught in component', error)

    //       //throw error;   //You can also throw the error to a global error handler
    //     }
    //   )
  }
  linkedInLogin(): void {
    this.document.location.href = `${this.serverUrl}ExternalLogin/external-login?provider=LinkedIn&returnUrl=/home`;
  }
}
<section class="inner-bg">
  <div class="container">
    <div class="row">
      <div class="col-xl-12 col-lg-12 col-md-12 col-12">
        <div class="inner-title">
          <h1 *ngIf="!_customFunctions.IsRTL()" >
            <img src="assets/images/icon/register.png" alt="" class="img-fluid icon-img" style="max-width: 7%;">

            {{'NAV.REGISTER' | translate}}</h1>
          <h1 *ngIf="_customFunctions.IsRTL()" style="text-align: right;">
            <img src="assets/images/icon/register.png" alt="" class="img-fluid icon-img" style="max-width: 7%;">

            {{'NAV.REGISTER' | translate}}</h1>
        </div>
      </div>
    </div>
  </div>
</section>
<!-- Login banner -->
<section class="registerSction" id="registerSction">
  <div class="container">
    <div class="row">
      <div class="col-xl-8 col-lg-8 col-md-8 col-sm-12 col-12 register">
        <div class="card shadow-sm">
          <div class="card-body p-4">
            <form class="login_Form" [formGroup]="registerForm">
              <div class="row">
                <div class="col-md-6">
                  <div class="form-group">
                    <label for="FullName"  [ngClass]="customFunction.IsRTL()? 'label_arbic': ''" class="label">{{'BASE.TITLE' | translate}}</label>
                    <input type="text" formControlName="FullName" class="form-control" id="FullName"
                      placeholder="{{'BASE.TITLE' | translate}}" name="FullName" required>
                    <div *ngIf="submitted && registerForm.controls.FullName.errors" class="invalid-feedback2">
                      <span
                        *ngIf="submitted && registerForm.controls.FullName.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                    </div>
                  </div>
                </div>
                <div class="col-md-6">
                  <div class="form-group">
                    <label for="email"  [ngClass]="customFunction.IsRTL()? 'label_arbic': ''" class="label">{{'BASE.EMAIL' | translate}}</label>
                    <input type="email" formControlName="Email" class="form-control" id="email"
                      placeholder="{{'BASE.EMAIL' | translate}}" required
                      pattern="^[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,4}$">
                    <div *ngIf="submitted && registerForm.controls.Email.errors" class="invalid-feedback2">
                      <span
                        *ngIf="submitted && registerForm.controls.Email.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                    </div>
                   
                  </div>
                </div>
                <div class="col-md-6">
                  <div class="form-group">
                    <label for="PhoneNumber"  [ngClass]="customFunction.IsRTL()? 'label_arbic': ''" class="label">{{'BASE.PHONE_NUMBER' | translate}}</label>
                    <input type="text" formControlName="PhoneNumber" class="form-control" id="PhoneNumber"
                      placeholder="{{'BASE.PHONE_NUMBER' | translate}}">
                    <div *ngIf="submitted && registerForm.controls.PhoneNumber.errors" class="invalid-feedback2">
                      <span
                        *ngIf="submitted && registerForm.controls.PhoneNumber.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                    </div>
                   
                  </div>

                </div>

                <div class="form-group col-md-6">
                  <label for="" class="label"  [ngClass]="customFunction.IsRTL()? 'label_arbic': ''">{{'BASE.COUNTRY' | translate}}</label>
                  <select class="form-control" formControlName="CountryId">
					 <option value="" disabled  *ngIf="!customFunction.IsRTL()">Select Country</option>
					<option value="" disabled  *ngIf="customFunction.IsRTL()">اختر الخدمة</option>
                    <option *ngFor="let country of countries$ |async" [value]="country.id">{{country.name}}
                    </option>
                  </select>
                  <div *ngIf="submitted && registerForm.controls.CountryId.errors" class="invalid-feedback2">
                    <span
                      *ngIf="submitted && registerForm.controls.CountryId.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                  </div>
                </div>
              </div>
              <div class="row">
                <div class="col-md-6">
                  <div class="form-group">
                    <label for="Password"  [ngClass]="customFunction.IsRTL()? 'label_arbic': ''" class="label">{{'BASE.PASSWORD' | translate}}</label>
                    <input type="password" formControlName="Password" class="form-control"
                      placeholder="{{'BASE.PASSWORD' | translate}}" name="password" autocomplete="off">
                    <div *ngIf="submitted && registerForm.controls.Password.errors" class="invalid-feedback2">
                      <span
                        *ngIf="submitted && registerForm.controls.Password.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                    </div>
                   
                  </div>
                </div>
                <div class="col-md-6">
                  <div class="form-group">
                    <label for="ConfirmPassword" [ngClass]="customFunction.IsRTL()? 'label_arbic': ''" class="label">{{'BASE.CONFIRM_PASSWORD' | translate}}</label>
                    <input type="password" formControlName="ConfirmPassword" class="form-control"
                      placeholder="{{'BASE.CONFIRM_PASSWORD' | translate}}" name="confirmPassword" autocomplete="off">
                    <div *ngIf="submitted && registerForm.controls.ConfirmPassword.errors" class="invalid-feedback2">
                      <span
                        *ngIf="submitted && registerForm.controls.ConfirmPassword.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                    </div>
                   
                  </div>
                </div>
              </div>
              <div *ngIf="!customFunction.IsRTL()" class="row">
                <label for="role" class="label col-md-12">{{'BASE.ACCOUNT_TYPE' | translate}}</label>
                <div class="col-md-12">
                  <div class="form-check-inline" *ngFor="let role of roleTypes">
                    <label class="form-check-label">
                      <input type="radio" class="form-check-input" (ngModelChange)="onSelectUserType($event)"
                        formControlName="Role" name="Role" [value]="role">
                        {{role.title}}
                    </label>
                  </div>
                  <div *ngIf="submitted && registerForm.controls.Role.errors" class="invalid-feedback2">
                    <span
                      *ngIf="submitted && registerForm.controls.Role.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                  </div>
                 
                </div>
              </div>
              <div *ngIf="customFunction.IsRTL()" class="row" >
                <label for="role" class="label col-md-12 label_arbic">{{'BASE.ACCOUNT_TYPE' | translate}}</label>
                <div class="col-md-12" style="float: right;">
                  <div class="form-check-inline" *ngFor="let role of abrroleTypes" style="float: right;">
                    <label class="form-check-label">
                      <input type="radio" class="form-check-input" (ngModelChange)="onSelectUserType($event)"
                        formControlName="Role" name="Role" [value]="role">
                        {{role.title}}
                    </label>
                  </div>
                  <div *ngIf="submitted && registerForm.controls.Role.errors" class="invalid-feedback2" >
                    <span
                      *ngIf="submitted && registerForm.controls.Role.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                  </div>
                  
                </div>
              </div>
              
              <div class="row">


                <div class="form-group col-md-6" *ngIf="isFreelancer === true">
				
                  <label for="" [ngClass]="customFunction.IsRTL()? 'label_arbic': ''" class="label">{{'BASE.CATEGORY' | translate}}</label>
                  <select class="form-control" formControlName="ServiceId">
                    <option value="" disabled  *ngIf="!customFunction.IsRTL()">Select service</option>
					<option value="" disabled  *ngIf="customFunction.IsRTL()">اختر الخدمة</option>
                    <option *ngFor="let service of services$ |async" [value]="service.id">{{service.name}}
                    </option>
                  </select>
                  <div *ngIf="submitted && registerForm.controls.ServiceId.errors" class="invalid-feedback2">
                    <span
                      *ngIf="submitted && registerForm.controls.ServiceId.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                  </div>
                </div>
              </div>
              <div class="row my-2">
                <div class="col-md-6 col-sm-6 col-6" id="rcptcha" >
                  <div class="form-group" [ngClass]="customFunction.IsRTL()? 'div_arbic': ''">
                    <label class="form-check-label">
                      <input type="checkbox" name="is_agree_terms_conditions"
                        value="is_agree_terms_conditions" formControlName="PrivacyAndTerms">

                      <a class="forgt_txt text-info" target="_blank" routerLink="/terms">&nbsp;{{'BASE.TERMS_AND_CONDITIONS' | translate}}</a>


                    </label>
                    <div *ngIf="submitted && registerForm.controls.PrivacyAndTerms.errors" class="invalid-feedback2">
                      <span
                        *ngIf="submitted && registerForm.controls.PrivacyAndTerms.errors">{{'BASE.IS_REQUIRED' | translate}}</span>
                    </div>
                    
                  </div>
                </div>
                <div class="col-md-6 rcpt">
                  <ngx-recaptcha2 #captchaElem siteKey="6Lect8YgAAAAALUuS4PTWI7Og3N08doxJW4UPnLR"
                    formControlName="recaptcha" (success)="handleSuccess($event)" [size]="size" [hl]="lang"
                    [theme]="theme" [type]="type">
                  </ngx-recaptcha2>
                  
                </div>
              </div>
			  <button type="button" (click)="registerUser()" class="btn btn-green  btn-block" id="signupbutton">
                {{'BASE.SUBMIT' | translate}}</button>
            </form>
          </div>
        </div>
      </div>

      <div class="col-xl-4 col-lg-4 col-md-4 col-sm-12 col-12 mt-2">
        <div class="row">
          <div class="col-md-12 text-center">
            <img alt="" src="assets/images/logo.png" class="img-fluid mb-4">
			
            <p *ngIf="!customFunction.IsRTL()" class="para-text m-0 mb-3">- or Signup with -</p>
			<p *ngIf="customFunction.IsRTL()" class="para-text m-0 mb-3">- أو اشترك مع -</p>
          </div>
        </div>

        <div class="row">
          <div class="col-md-12 text-center mb-3">
            <a (click)="googleLogin()" class="btn btn-gmail mb-2"><i class="far fa-envelope social-icn"></i>Google</a>
            <a (click)="linkedInLogin()" class="btn btn-fb mr-3 mb-2"> <i  class="fa fa-linkedin social-icn"></i> LinkedIn</a>
          </div>
        </div>

        <div class="row">
          <div class="col-md-12 text-center">
    
			
			<p *ngIf="!customFunction.IsRTL()" class="para-text m-0 mb-3">Already Have an Account ?
              <a [routerLink]="['/account/login']" class="btn-signup"> SIGN IN</a></p>
			<p *ngIf="customFunction.IsRTL()" class="para-text m-0 mb-3">هل لديك حساب ؟
              <a [routerLink]="['/account/login']" class="btn-signup"> تسجيل الدخول</a></p>
          </div>
        </div>
      </div>
    </div>

  </div>
</section>

<app-account-footer style="position: fixed; left: 0; bottom: 0; width: 100%;"></app-account-footer>
